import { NgModule, CUSTOM_ELEMENTS_SCHEMA } from '@angular/core';
import { RouterModule } from '@angular/router';

import { SharedModule } from 'app/shared/shared.module';
import {
  CodeTypeDeleteDialogComponent,
  CodeTypeComponent,
  CodeTypeMaintainComponent,
  codeTypeRoute,
  codeTypePopupRoute,
  CodeTypeService,
} from './';

const ENTITY_STATES = [...codeTypeRoute, ...codeTypePopupRoute];

@NgModule({
  imports: [SharedModule, RouterModule.forChild(ENTITY_STATES)],
  declarations: [CodeTypeComponent, CodeTypeMaintainComponent, CodeTypeDeleteDialogComponent],
  entryComponents: [CodeTypeComponent, CodeTypeMaintainComponent, CodeTypeDeleteDialogComponent],
  providers: [CodeTypeService],
  schemas: [CUSTOM_ELEMENTS_SCHEMA],
})
export class CodeTypeModule {}
